import React from "react";
import Navbar from "./components/Navbar";
import Hero from "./components/Hero";
import About from "./components/About";
import Projects from "./components/Projects";
import ChatbotSection from "./components/ChatbotSection";
import Footer from "./components/Footer";
import TargetCursor from './components/TargetCursor';
import DarkVeil from './components/DarkVeil';

export default function App() {
  return (
    <div className="relative min-h-screen bg-black text-gray-100 overflow-x-hidden">
      {/* veil sits absolutely and covers the whole screen */}
      <DarkVeil 
        className="absolute inset-0 -z-10 pointer-events-none opacity-80" 
        hueShift={0.0}
        noiseIntensity={0.02}
        scanlineIntensity={0.02}
        speed={0.5}
        scanlineFrequency={0.002}
        warpAmount={0.01}
        resolutionScale={1}
      />

      <TargetCursor spinDuration={2} hideDefaultCursor={true} />

      <Navbar />
      <main>
        <Hero />
        <About />
        <Projects />
        <ChatbotSection />
      </main>
      <Footer />
    </div>
  );
}
